    return (
        <>
            <div className="about_pic">
                <div className="text">
                    <p className={classes.font}>this is me</p>
                    <p>Här ska det stå töntig skit om mig. Eller egentlingen om mitt liv. Student som junglerar livet, studier, jobb, välgörenhetarbete och reality. 
